            <g clip-path="url(#SVGID_2_)">
                <text transform="matrix(1 0 0 1 44 127.4824)"><tspan x="0" y="0" fill="#FDBD10" font-family="'Georgia'" font-size="28">The shared values of UPS</tspan><tspan x="0" y="33.6" fill="#FDBD10" font-family="'Georgia'" font-size="28">and the military</tspan></text>
            </g>
            <g clip-path="url(#SVGID_2_)">
                <text transform="matrix(1 0 0 1 337.8291 127.4824)" fill="#FDBD10" font-family="'GuardianEgyp-Light'" font-size="28"> </text>
            </g>
            <g clip-path="url(#SVGID_2_)">
                <text transform="matrix(1 0 0 1 44 189.4824)"><tspan x="0" y="0" fill="#FDBD10" font-family="'Georgia'" font-size="11">Among the many reasons U.S. veterans thrive here</tspan><tspan x="0" y="13.2" fill="#FDBD10" font-family="'Georgia'" font-size="11">is a mutual belief in doing things right.</tspan></text>
            </g>
            <g clip-path="url(#SVGID_2_)">
                <text transform="matrix(1 0 0 1 288.541 189.4824)" fill="#FDBD10" font-family="'GuardianEgyp-Regular'" font-size="11"> </text>
