            <g clip-path="url(#SVGID_2_)">
                <text transform="matrix(1 0 0 1 44 260.3022)" fill="#FFFFFF" font-family="'Georgia'" font-size="28">Integrity</text>
            </g>
            <g clip-path="url(#SVGID_2_)">
                <text transform="matrix(1 0 0 1 44 281.3022)"><tspan x="0" y="0" fill="#FFFFFF" font-family="'Georgia'" font-size="10">In the military, it’s all about honor. At UPS,</tspan><tspan x="0" y="12" fill="#FFFFFF" font-family="'Georgia'" font-size="10">it’s who we are and the foundation of all we do.</tspan></text>
            </g>
            <g clip-path="url(#SVGID_2_)">
                <text transform="matrix(1 0 0 1 216.5864 281.3022)" fill="#FFFFFF" font-family="'UPSSans-Regular'" font-size="10"> </text>
            </g>
            <g clip-path="url(#SVGID_2_)">
                <text transform="matrix(1 0 0 1 263.52 342.3198)" fill="#FFFFFF" font-family="'Georgia'" font-size="28">Teamwork</text>
            </g>
            <g clip-path="url(#SVGID_2_)">
                <text transform="matrix(1 0 0 1 263.52 363.3198)"><tspan x="0" y="0" fill="#FFFFFF" font-family="'Georgia'" font-size="10">In the military, completing missions as a team is </tspan><tspan x="0" y="12" fill="#FFFFFF" font-family="'Georgia'" font-size="10">a way of life. At UPS, determined people working </tspan><tspan x="0" y="24" fill="#FFFFFF" font-family="'Georgia'" font-size="10">together can accomplish anything.</tspan></text>
            </g>
            <g clip-path="url(#SVGID_2_)">
                <text transform="matrix(1 0 0 1 166.3198 430.2314)" fill="#FFFFFF" font-family="'Georgia'" font-size="28">Service</text>
            </g>
            <g clip-path="url(#SVGID_2_)">
                <text transform="matrix(1 0 0 1 166.3198 451.2314)"><tspan x="0" y="0" fill="#FFFFFF" font-family="'Georgia'" font-size="10">In the military, putting others before self is the very definition </tspan><tspan x="0" y="12" fill="#FFFFFF" font-family="'Georgia'" font-size="10">of service. At UPS, meeting the needs of our customers and</tspan><tspan x="0" y="24" fill="#FFFFFF" font-family="'Georgia'" font-size="10">communities is central to our success. </tspan></text>
            </g>
            <g clip-path="url(#SVGID_2_)">
                <text transform="matrix(1 0 0 1 44 633.373)"><tspan x="0" y="0" fill="#FFFFFF" font-family="'Georgia'" font-size="10">In the military, precision leads to excellence, and cutting corners is never an option. </tspan><tspan x="0" y="12" fill="#FFFFFF" font-family="'Georgia'" font-size="10">At UPS, we never stop pursuing faster, smarter and better solutions.</tspan></text>
            </g>
            <g clip-path="url(#SVGID_2_)">
                <text transform="matrix(1 0 0 1 198.1123 518.1963)" fill="#371400" font-family="'Georgia'" font-size="28">Accountability</text>
            </g>
            <g clip-path="url(#SVGID_2_)">
                <text transform="matrix(1 0 0 1 198.1123 539.1963)"><tspan x="0" y="0" fill="#371400" font-family="'Georgia'" font-size="10">In the military, you have a duty to your teammates, and no </tspan><tspan x="0" y="12" fill="#371400" font-family="'Georgia'" font-size="10">one leaves anyone behind. At UPS, we take responsibility for </tspan><tspan x="0" y="24" fill="#371400" font-family="'Georgia'" font-size="10">our actions, for each other’s safety, and we all grow together.</tspan></text>
            </g>
            <g clip-path="url(#SVGID_2_)">
                <text transform="matrix(1 0 0 1 263.52 699.3379)" fill="#FFFFFF" font-family="'Georgia'" font-size="28">Diversity &amp; Opportunity</text>
            </g>
            <g clip-path="url(#SVGID_2_)">
                <text transform="matrix(1 0 0 1 263.52 720.3379)"><tspan x="0" y="0" fill="#FFFFFF" font-family="'Georgia'" font-size="10">In the military, diverse backgrounds and beliefs meld into one united </tspan><tspan x="0" y="12" fill="#FFFFFF" font-family="'Georgia'" font-size="10">force. At UPS, our strength starts with tolerance and respect for all,</tspan><tspan x="0" y="24" fill="#FFFFFF" font-family="'Georgia'" font-size="10">and anyone who works hard can rise through our ranks.</tspan></text>
            </g>
            <g clip-path="url(#SVGID_2_)">
                <text transform="matrix(1 0 0 1 538.2695 732.3379)" fill="#FFFFFF" font-family="'UPSSans-Regular'" font-size="10"> </text>
            </g>
